window.bookSummaryJSON = "<p>After the successful but disastrous raid on Mount Weather, Daemon's facing the impossible. Katy is gone. Taken. Everything becomes about finding her. Taking out anyone who stands in his way? Done. Burning down the whole world to save her? Gladly. Exposing his alien race to the world? With pleasure. </p> <p>Surrounded by enemies, the only way Katy can come out of this is to adapt. After all, there are sides of Daedalus that don't seem entirely crazy, but the group's goals are frightening and the truths they speak even more disturbing. Who are the real bad guys? Daedalus? Mankind? Or the Luxen? </p> <p>But the most dangerous foe has been there all along, and when the truths are exposed and the lies come crumbling down, which side will Daemon and Katy be standing on? And will they even be together? </p>"; 
